HQ very rare promo music video. &quot;She's a Woman&quot; is a song by the Beatles. It was released as the B-side to &quot;I Feel Fine&quot; in 1964, their last single release that year. It reached number 4 on the Billboard Hot 100 from frequent airplay.

The song, penned by Paul McCartney (though credited to Lennon Ã¢â‚¬â€œ McCartney), was his attempt at imitating the vocal style of Little Richard. This is why the song is in such a high register, even for McCartney's tenor range. Some takes of the song (especially recordings of live concerts) feature an extended outro. John Lennon was quoted as saying, &quot;We were so excited to say 'turn me on' you know, about marijuana and all that... using it as an expression.&quot;

The structure of the song is fairly simple, with the melody carried mostly by McCartney's voice. His bass and a backing piano produce a countermelody, with Lennon's guitar playing chords on the backbeat. After the first verse, the piano also plays chords on the upbeats. George Harrison plays a bright guitar solo during the middle eight.

&quot;She's A Woman&quot; was a direct influence on Bob Dylan's song &quot;Obviously 5 Believers&quot; which appeared on his 1966 album Blonde On Blonde.

The Beatles were an English rock band formed in Liverpool in 1960. They became the most commercially successful and critically acclaimed act in the rock music era. The group's best-known lineup consisted of John Lennon, Paul McCartney, George Harrison, and Ringo Starr. Rooted in skiffle and 1950s rock and roll, the Beatles later utilized several genres, ranging from pop ballads to psychedelic rock, often incorporating classical and other elements in innovative ways. In the early 1960s, their enormous popularity first emerged as &quot;Beatlemania&quot;, but as their songwriting grew in sophistication, they came to be perceived by many fans and cultural observers as an embodiment of the ideals shared by the era's sociocultural revolutions. 
